import React from 'react';
import "./menu.css"

const Menu = () => {
    const menus = [
        {
            id: 1,
            title: "Home",
            url: "/home",
        },
        {
            id: 1,
            title: "User List",
            url: "/user-list",
        },
        {
            id: 1,
            title: "Post Log",
            url: "/post-log",
        },
        {
            id: 1,
            title: "Login",
            url: "/login",
        },
    ];
    return (
        <nav>
            <ul className='menu'>

            </ul>
        </nav>
    );
}

export default Menu;
